class Solution(object):
    def countSubarrays(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """
        max_num = max(nums)
        count, total, n = 0, 0, len(nums)
        for i in range(n):
            if nums[i] == max_num:
                count += 1
            if count >= k:
                left, right = i - 1, i + 1
                while left >= 0 and nums[left] != max_num:
                    left -= 1
                while right < n and nums[right] != max_num:
                    right += 1
                total += (i - left) * (right - i)
        return total
